import {Box, Button, Heading, HStack, IconButton, Text, VStack} from "@chakra-ui/react";
import {useEffect, useState} from "react";
import axios from "axios";
import {useParams} from "react-router-dom";
import {useAdmin} from "../../../hooks/useAuth";
import {EditIcon} from "@chakra-ui/icons";

const QuizEditor = () => {

    const {id} = useParams();
    const [quiz, setQuiz] = useState(null);
    const {setFullMode} = useAdmin();
    useEffect(() => {
        const fetchQuizDetails = async () => {
            const url = `http://localhost:8080/api/v1/admin/quiz-management/managed-quizzes/${id}`;
            try {
                const resp = await axios.get(url, {
                    headers: {
                        "Authorization": `Bearer ${localStorage.getItem("accessToken")}`
                    }
                })
                resp.status === 200 && setQuiz(resp.data);
                console.log(resp.data)
            } catch (e) {
                console.log("Failed to get quiz details with id " + id);
            }
        }
        fetchQuizDetails();
    }, [])
    return <>
        <VStack align={'start'}  minH={'100vh'}>
            <HStack bg={'teal'} color={'white'}>
                <Text>Quiz title</Text>
                <IconButton aria-label={"icon"} icon={<EditIcon/>}/>
            </HStack>
        </VStack>

    </>
}

export default QuizEditor;
